import { SET_EMAIL, SET_CURRENCIES } from './actionTypes';

export function saveEmail(email) {
  return {
    type: SET_EMAIL,
    email,
  };
}

export function setCurrencies() {
  return {
    type: SET_CURRENCIES,
    email,
  };
}
